import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import api from './service/api';


class Main extends React.Component{
    constructor(props){
      super(props);
      this.state = {};
    }

    componentDidMount(){
      this.loadData();
    }

    loadData = async () => {
      try{
        let result = await api.get('/api/v2/pages/?type=posts.PostPage&fields=post_image');
        this.setState({
          list: result.data
        });
      }catch(e){
        console.log(e)
      }
    }

    render(){
      var { list } = this.state;
      console.log(this.state.list)
      return(
        <div id='wrapper'>
          <h1>OIIIIIIIIIAFD</h1>
          {list &&
            <div> 
              <img 
                src = {list.items[0].post_image.url}
                width = {list.items[0].post_image.width}
                height =  {list.items[0].post_image.height}
              />
              <ul>
                {list && 
                list.items.map(item => (
                  <li
                    key = {item.id}
                  >
                    <p>{item.title}</p>
                    <img 
                      src = {`http://localhost:8000${item.post_image.url}`}
                      width = {item.post_image.width}
                      height = {item.post_image.height}
                    />
                  </li>
                ))
                }
              </ul>
            </div>   
           }
        </div>
      )
    }
}

ReactDOM.render(
  <Main />,
  document.getElementById('root')
);
